import React from "react";
import { NavLink } from 'react-router-dom'; 

const Nav = (props) => {
  return (
    <div>
      <NavLink onClick={props.getSubreddit} to="/" subreddit = "">Home</NavLink>
      <NavLink to="/section/US" subreddit = "USNEWS">US</NavLink>
      <NavLink to="/section/World" subreddit = "">World</NavLink>
      <NavLink to="/section/Politics" subreddit = "">Politics</NavLink>
      <NavLink to="/section/Business" subreddit = "">Business</NavLink>
      <NavLink to="/section/Technology" subreddit = "">Technology</NavLink>
      <NavLink to="/section/Sports" subreddit = "">Sports</NavLink>
      <NavLink to="/section/Gaming" subreddit = "">Gaming</NavLink>
      <NavLink to="/section/Feedback" subreddit = "">Feeback</NavLink>
    </div>
  );
};

export default Nav;
